import './App.css';
import HeroImage from "./pictures/MagdaHero.jpg"// with import
import {Parallax,ParallaxLayer} from '@react-spring/parallax'
import { useTrail,animated } from '@react-spring/web';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faArrowUpRightFromSquare} from '@fortawesome/free-solid-svg-icons';




function App() {
  return (
    <div>



    <Parallax pages={4}>
      <ParallaxLayer>

        <NavBar></NavBar>

      </ParallaxLayer>
      <ParallaxLayer factor={1} speed={0.5}>
        <div className=" h-screen flex justify-center items-center">
          <HeroText></HeroText>
        </div>
      </ParallaxLayer>
      <ParallaxLayer offset={0.6} speed={0.75}>
        <HeroSubText></HeroSubText>
      </ParallaxLayer>
      <ParallaxLayer className='z-10' speed={0.75} offset={0.999} factor={3}>
        <ProjectWrapper></ProjectWrapper>
      </ParallaxLayer>
      <ParallaxLayer className=' shadow-lg' offset={2.8} speed={0.80}>

          <AboutMe></AboutMe>

      </ParallaxLayer>
      <ParallaxLayer offset={3.4} speed={0.4}>

          <ContactMe></ContactMe>

      </ParallaxLayer>
    </Parallax>

    </div>
  );

}
function NavBar(){
      return(
        <div className='font-Nunito font-thin text-2xl '>
          <nav className="flex justify-between items-center content-center">
          <a className='m-5 text-3xl flex items-center gap-1' href='./index'> <span className=' bg-botticelli-800 rounded-full block w-2 h-2'></span>Magda Nemes</a>
            <ul className='flex gap-4 items-center'>
              <li >About</li>
              <li>Projects</li>
            </ul>
            <a className='mx-10' href='./'>Contact Me</a>
          </nav>
          <CreateLine></CreateLine>
        </div>
      )
}


function HeroImageDisplay(){
  const [trails, api] = useTrail(1, () => ({
    from: { opacity: 0 },
    to: { opacity: 1 },
    config: { mass: 1, tension: 300, friction: 100 }
  }));

        return(
          <div>
          {trails.map(()=>(
            <animated.div>

              <div className='flex flex-col'>

                    <img src={HeroImage} className="w-56 h-auto  mx-10" alt="HeroImage"></img>

              </div>

            </animated.div>

            )
          )
          }
          </div>
        )

}


  function HeroText() {
    const [trails] = useTrail(1, () => ({
      from: { opacity: 0 },
      to: { opacity: 1 },
      config: { mass: 1, tension: 200, friction: 150 }
    }));

    return (
      <div>
        {trails.map((props,index) => (
          <animated.div style={props} key={index+1} className="  text-center font-normal ">
           <h1 className='text-gun-powder-950 text-[10rem] font-GothicA1'>Magda Nemes</h1>

          </animated.div>
        ))}
      </div>
    );
  }

  function HeroSubText(){
    const [trails] = useTrail(1, () => ({
      from: { opacity: 0 },
      to: { opacity: 1 },
      config: { mass: 1, tension: 100, friction: 150 }
    }));

    return (
      <div>
